import "./register.css";
import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import Header from "../header-footer/header";

export default function RegisterComponent() {

  const navigate = useNavigate();
  const [userName, setUserName] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [phoneNumber, setPhoneNumber] = useState("")
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [sucess, setSucess] = useState(null);

  // handeling user registration
  const registerUser = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    setSucess(null);

    try {
      if (password !== confirmPassword) {
        setError("Passwords donot match!");
        setLoading(false);
      } else {
        const response = await fetch("http://localhost:5000/api/auth/register", {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            userName,
            password,
            phoneNumber
          }),
        });

        if (!response.ok) {
          throw new Error("Network response was not ok");
        }

        const data = response.json();
        console.log("Sucess : ", data);
        setSucess("Registration Sucessfull!!");
        // navigate("/login");
      }
    } catch (error) {
      setError(error.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <>
    <Header />
    <div className="register-main">
      <img src="https://img.freepik.com/free-vector/hand-holding-phone-with-digital-wallet-service-sending-money-payment-transaction-transfer-through-mobile-app-flat-illustration_74855-20589.jpg?t=st=1726323866~exp=1726327466~hmac=b644071f0b54aabbae8b951747dc8ce0b02aae94d01391b7f53ec83818bd71f1&w=900"></img>
      <form className="register-container" onSubmit={registerUser}>
        <span>FMS</span>
        <label htmlFor="username">Username </label>
        <input
            type="text"
            id="userName"
            className="register-input"
            placeholder="John920"
            value={userName}
            onChange={(e) => setUserName(e.target.value)}
            required
          />

        <br />
        <label htmlFor="phoneNumber">Phone Number </label>
        <input
          type="text"
          id="phoneNumber"
          className="register-input"
          placeholder="9457781236"
          value={phoneNumber}
          onChange={(e) => setPhoneNumber(e.target.value)}
          required
        />
        <br />
        <label htmlFor="password">Password </label>
        <input
          type="password"
          id="password"
          className="register-input"
          placeholder="****"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          maxLength="12"
          minLength="8"
          required
        />
        <br />
        <label htmlFor="confirmPassword">Confirm Password </label>
        <input
          type="password"
          id="confirmPassword"
          className="register-input"
          placeholder="****"
          value={confirmPassword}
          onChange={(e) => setConfirmPassword(e.target.value)}
          maxLength="12"
          minLength="8"
          required
        />
        <br />
        {error && <p style={{color: 'red', textAlign:"center"}} className="error-message">Internal server Error</p>}
        {sucess && <p className="success-message">{sucess}</p>}
        <button type="submit" disabled={loading} className="submit-button">
          {loading ? "Loading" : "Register"}
        </button>
        <p class="go-to-login">
          Have an account?{" "}
          <Link class="link" to="#">
            Login
          </Link>
        </p>
      </form>
    </div>
    </>
  );
}
